description:
Times have changed and the nurses in the medical field take more responsibilities on as the doctors have become more stretched in their duty to see to those who are sick. Here is one testimonial of a patient who has deal with the transsexual nurses at his particular hospital:

Since getting health care, I've started going to a new doctor and I'm so glad I did. Not so much for the doctor's knowledge, but the nurse there is so hot! And after taking my pressure, she told me to take off my pants. The problem was the huge hard-on I had going. She made me feel completely at ease though when she showed me hers as well. I've already scheduled my next check-up! - Devoted Patient.

